(33, 1, '2021-10-22 18:03:55', '2021-10-22 16:03:55', '<label> Twoje imię i nazwisko\n    [text* your-name] </label>\n\n<label> Twój adres e-mail\n    [email* your-email] </label>\n\n<label> Temat\n    [text* your-subject] </label>\n\n<label> Twoja wiadomości (opcjonalne)\n    [textarea your-message] </label>\n\n[submit \"Wyślij\"]\n[_site_title] - \"[your-subject]\"\n[_site_title] <wordpress@cut2code.test>\nNadawca: [your-name] <[your-email]>\nTemat: [your-subject]\n\nTreść wiadomości:\n[your-message]\n\n-- \nTa wiadomość została wysłana przez formularz kontaktowy na stronie [_site_title] ([_site_url]).\n[_site_admin_email]\nReply-To: [your-email]\n\n0\n0\n\n[_site_title] - \"[your-subject]\"\n[_site_title] <wordpress@cut2code.test>\nTreść wiadomości:\n[your-message]\n\n-- \nTa wiadomość została wysłana przez formularz kontaktowy na stronie [_site_title] ([_site_url]).\n[your-email]\nReply-To: [_site_admin_email]\n\n0\n0\nTwoja wiadomość została wysłana. Dziękujemy!\nWystąpił problem z wysłaniem twojej wiadomości. Spróbuj ponownie później.\nPrzynajmniej jedno pole jest błędnie wypełnione. Sprawdź wpisaną treść i spróbuj ponownie.\nWystąpił problem z wysłaniem twojej wiadomości. Spróbuj ponownie później.\nMusisz wyrazić zgodę na powyższe zapisy, aby móc wysłać formularz.\nWymagane jest wypełnienie tego pola.\nZawartość tego pola jest zbyt długa.\nZawartość tego pola jest zbyt krótka.\nPodczas wgrywania pliku wystąpił nieznany błąd.\nNie możesz wgrywać plików tego typu.\nTen plik jest zbyt duży.\nWystąpił błąd podczas wgrywania pliku.', 'Formularz 1', '', 'publish', 'closed', 'closed', '', 'formularz-1', '', '', '2021-10-22 18:03:55', '2021-10-22 16:03:55', '', 0, 'http://cut2code.test/?post_type=wpcf7_contact_form&p=33', 0, 'wpcf7_contact_form', '', 0),
(34, 1, '2021-10-22 18:25:10', '2021-10-22 16:25:10', '<label> \r\n    [text* your-name placeholder \"Full Name\"] </label>\r\n\r\n<label> \r\n    [email* your-email placeholder \"Email\"] </label>\r\n\r\n<label>\r\n    [tel Phone placeholder \"Phone\"]</label>\r\n\r\n<label> \r\n     [text text placeholder \"Message\"]</label>\r\n\r\n\r\n[submit \"SEND\"]\n1\n[_site_title] - \"[your-subject]\"\n[_site_title] <wordpress@cut2code.test>\n[_site_admin_email]\nNadawca: [your-name] <[your-email]>\r\nTemat: [your-subject]\r\n\r\nTreść wiadomości:\r\n[your-message]\r\n\r\n-- \r\nTa wiadomość została wysłana przez formularz kontaktowy na stronie [_site_title] ([_site_url]).\nReply-To: [your-email]\n\n\n\n\n[_site_title] - \"[your-subject]\"\n[_site_title] <wordpress@cut2code.test>\n[your-email]\nTreść wiadomości:\r\n[your-message]\r\n\r\n-- \r\nTa wiadomość została wysłana przez formularz kontaktowy na stronie [_site_title] ([_site_url]).\nReply-To: [_site_admin_email]\n\n\n\nTwoja wiadomość została wysłana. Dziękujemy!\nWystąpił problem z wysłaniem twojej wiadomości. Spróbuj ponownie później.\nPrzynajmniej jedno pole jest błędnie wypełnione. Sprawdź wpisaną treść i spróbuj ponownie.\nWystąpił problem z wysłaniem twojej wiadomości. Spróbuj ponownie później.\nMusisz wyrazić zgodę na powyższe zapisy, aby móc wysłać formularz.\nWymagane jest wypełnienie tego pola.\nZawartość tego pola jest zbyt długa.\nZawartość tego pola jest zbyt krótka.\nPodczas wgrywania pliku wystąpił nieznany błąd.\nNie możesz wgrywać plików tego typu.\nTen plik jest zbyt duży.\nWystąpił błąd podczas wgrywania pliku.\nFormat daty jest niepoprawny.\nData jest wcześniejsza, niż pierwsza dozwolona.\nData jest późniejsza, niż ostatnia dozwolona.\nFormat liczby jest niepoprawny.\nTa liczba jest mniejsza, niż minimalna dopuszczana.\nTa liczba jest większa, niż maksymalna dopuszczalna.\nOdpowiedź w quizie jest nieprawidłowa.\nWprowadzony adres e-mail jest nieprawidłowy.\nWprowadzony adres URL jest nieprawidłowy.\nWprowadzony numer telefonu jest nieprawidłowy.', 'Bez tytułu', '', 'publish', 'closed', 'closed', '', 'bez-tytulu', '', '', '2021-10-22 18:36:55', '2021-10-22 16:36:55', '', 0, 'http://cut2code.test/?post_type=wpcf7_contact_form&#038;p=34', 0, 'wpcf7_contact_form', '', 0),
